import {Link} from 'react-router-dom'

const Card = (props)=>{
    return(
        <div >
            <Link>
            <h1>Name</h1>
            <h2 >{props.name}</h2>
            <img src={props.image} alt="Image not found" />
            <h1 >Genres</h1>
            {
            props.genres?.map(genre => (
            <p>{props.genres}</p>
            ))
            }
            </Link>
        </div>
    )
}

export default Card
